define(['mage/translate'],function($t){'use strict';function streetAddressesAreDifferent(uncleanAddress,cleanAddress){uncleanAddress.street_address.filter(function(val){return val.length>0;});if(uncleanAddress.street_address.length!==cleanAddress.street_address.length){return true;}
for(let index=0,length=uncleanAddress.street_address.length;index<length;++index){if(uncleanAddress.street_address[index]!==cleanAddress.street_address[index]){return true;}}
return false;}
return function(uncleanAddress,cleanAddress){const listedDifferences=[];if(streetAddressesAreDifferent(uncleanAddress,cleanAddress)){listedDifferences.push({type:'street',name:$t('Street Address'),value:cleanAddress.street_address,rawValue:cleanAddress.street_address});}
if(uncleanAddress.city!==cleanAddress.city){listedDifferences.push({type:'city',name:$t('City'),value:cleanAddress.city,rawValue:cleanAddress.city});}
if(uncleanAddress.main_division!==cleanAddress.region_name){listedDifferences.push({type:'region',name:$t('State/Province'),value:cleanAddress.region_name,rawValue:cleanAddress.region_id});}
if(uncleanAddress.postal_code!==cleanAddress.postal_code){listedDifferences.push({type:'postcode',name:$t('Zip/Postal Code'),value:cleanAddress.postal_code,rawValue:cleanAddress.postal_code});}
if(uncleanAddress.country!==cleanAddress.country_code){listedDifferences.push({type:'country',name:$t('Country'),value:cleanAddress.country_name,rawValue:cleanAddress.country_code});}
return listedDifferences;};});